import React from 'react';
import '../css/Navbar.css'

const Navbar = () => {
    return (
        <nav className="navbar">
            <div className="navbar__logo">TechShop</div>

            <ul className="navbar__menu">
                <li className="navbar__menu-item">Home</li>
                <li className="navbar__menu-item">Products</li>
                <li className="navbar__menu-item">Categories</li>
                <li className="navbar__menu-item">Contact</li>
            </ul>

            <div className="navbar__actions">
                <i className="navbar__ icon fas fa-search"></i>
                <i className="navbar__ icon fas fa-shopping-cart"></i>
                <i className="navbar__ icon fas fa-user"></i>
            </div>
        </nav>
    );
};

export default Navbar;
